  render() {
    return (
      <div className="App">
      Saarang DevOps App: Sayash Raaj CE19B113

		<Route path="/" component={Form} exact/>
       	<Route path="/FetchRandomUser" component={FetchRandomUser}/>
      </div>
    );
  }
}

export default App;
